import React from 'react';
import nav from '../styles/Nav.module.css';

const Nav = ({ open, setNavOpen }) => {
  return (
    <nav className={nav.main}>
      <ul>
        <li>
          <i className="fas fa-bars"></i>
        </li>
        <li>
          <h1>Houses</h1>  
        </li>
        <li>
          <i className="fas fa-search"></i>
        </li>
      </ul>
    </nav>
  )
}

export default Nav;
